agged-images/ztnamvnsows28vtngq3n.jpg','admin','2024-04-13 22:36:48','admin','2024-03-09 18:14:25','Giá vàng miếng biến động liên tục','Giá vàng miếng biến động liên tục','Giá vàng miếng biến động liên tục',2,1),(79,'https://res.cloudinary.com/dd1grolgr/image/upload/v1710344296/tagged-images/k9ykwv3w0sag0csputzz.jpg','abc-123','2024-04-14 22:38:21',NULL,'2024-03-10 22:38:21','Lạm phát Mỹ tiếp tục tăng tốc','Lạm phát Mỹ tiếp tục tăng tốc','Lạm phát Mỹ tiếp tục tăng tốc',2,1),(80,'https://res.cloudinary.com/dd1grolgr/image/upload/v1710489077/tagged-images/ztnamvnsows28vtngq3n.jpg','admin','2024-04-15 14:07:06','admin','2024-03-11 17:52:25','Hoài nghi về tuyên bố phản công năm 2024 của Ukraine','Hoài nghi về tuyên bố phản công năm 2024 của Ukraine','Hoài nghi về tuyên bố phản công năm 2024 của Ukraine',5,1),(81,'https://res.cloudinary.com/dd1grolgr/image/upload/v1714200920/tagged-images/irc9rwgpjvrhz4qrdcfy.jpg','admin','2024-04-16 14:14:32','admin','2024-04-27 13:55:30','<p>Ông Nguyễn Cảnh Anh trở thành Chủ tịch Hội đồng quản trị Eximbank, còn cựu Chủ tịch Bamboo Capital Nguyễn Hồ Nam làm Phó chủ tịch.</p><p>Ngân hàng thương mại cổ phần Xuất nhập khẩu Việt Nam (Eximbank, EIB) vừa thông báo việc bổ nhiệm các vị trí Hội đồng quản trị, sau phiên họp thường niên hôm qua.</p><p>Theo đó, ông Nguyễn Cảnh Anh đã được bầu giữ chức Chủ tịch Hội đồng quản trị Eximbank, thay bà Đỗ Hà Phương.</p><figure class=\"image image_resized\" style=\"width:47.06%;\"><img style=\"aspect-ratio:1020/612;\" src=\"data:image/jpeg;base64,\" width=\"1020\" height=\"612\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Ông Nguyễn Cảnh Anh - tân chủ tịch của Eximbank. Ảnh: EIB</i></span></p><p>Tân Chủ tịch Eximbank sinh năm 1979, được bầu vào Hội đồng quản trị nhà băng này trong phiên họp bất thường cuối năm 2023. Trước khi tham gia Eximbank, ông Cảnh Anh có nhiều năm làm việc tại các tập đoàn, định chế tài chính lớn như Techcombank, Viettel, Vingroup và gần nhất là EVN Finance.</p>','Eximbank thay chủ tịch','Eximbank thay chủ tịch',13,1),(82,'https://res.cloudinary.com/dd1grolgr/image/upload/v1710489077/tagged-images/ztnamvnsows28vtngq3n.jpg','admin','2024-04-17 14:19:32','admin','2024-03-13 17:46:02','Thanh niên Việt giúp cảnh sát Philippines triệt phá trung tâm lừa đảo','Thanh niên Việt giúp cảnh sát Philippines triệt phá trung tâm lừa đảo','Thanh niên Việt giúp cảnh sát Philippines triệt phá trung tâm lừa đảo',5,1),(92,'https://res.cloudinary.com/dd1grolgr/image/upload/v1714117540/tagged-images/tcfoaxmaubqalnsoszov.jpg','admin','2024-04-26 14:45:57',NULL,'2024-04-26 14:50:54','<p>Sáng 26/4, lãnh đạo Đảng, Nhà nước đặt vòng hoa, vào lăng viếng Chủ tịch Hồ Chí Minh nhân kỷ niệm 49 năm ngày thống nhất đất nước.</p><p>Đoàn đại biểu Ban Chấp hành Trung ương Đảng, Chủ tịch nước, Quốc hội, Chính phủ, Ủy ban Trung ương Mặt trận Tổ quốc Việt Nam sau đó dâng hương, tưởng niệm liệt sĩ tại Đài tưởng niệm trên đường Bắc Sơn.</p><p>Tham gia đoàn có Thủ tướng Phạm Minh Chính; Chủ tịch Quốc hội Vương Đình Huệ; Thường trực Ban Bí thư, Trưởng ban Tổ chức Trung ương Trương Thị Mai; Chủ tịch Ủy ban Trung ương Mặt trận Tổ quốc Việt Nam Đỗ Văn Chiến; Chủ nhiệm Tổng cục Chính trị Quân đội nhân dân Việt Nam Lương Cường.</p><p>Dự lễ viếng còn có nguyên Tổng bí thư Nông Đức Mạnh; nguyên Chủ tịch nước Nguyễn Xuân Phúc; nguyên Chủ tịch Quốc hội Nguyễn Văn An, Nguyễn Sinh Hùng, Nguyễn Thị Kim Ngân.</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"data:image/jpeg;base64,\" width=\"680\" height=\"408\"></figure>','Lãnh đạo Đảng, Nhà nước vào lăng viếng Chủ tịch Hồ Chí Minh','Lãnh đạo Đảng, Nhà nước vào lăng viếng Chủ tịch Hồ Chí Minh',2,1);
INSERT INTO `new` VALUES (94,'https://res.cloudinary.com/dd1grolgr/image/upload/v1714201333/tagged-images/t9w0igkj1i3tfonkh6nt.png','admin','2024-04-27 14:02:33',NULL,'2024-04-27 14:12:23','<p>\"Tôi xin lỗi người hâm mộ, ban huấn luyện và các cầu thủ Hàn Quốc\", Ernando nói trên kênh KBS. \"Tôi không cố ý khiêu khích đối thủ, mà chỉ vì tôi quá phấn khích sau khi đẩy được quả đá luân lưu. Tôi làm vậy vì thần thượng thủ môn Emiliano Martinez, và vì tôi đã đối đầu với anh ấy một lần\".</p><figure class=\"image image_resized\" style=\"width:46.35%;\"><img style=\"aspect-ratio:1020/612;\" src=\"data:image/png;base64,\" width=\"1020\" height=\"612\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Ernando Ari nhận thẻ vàng sau khi khiêu khích đối thủ Hàn Quốc ở loạt đá luân lưu tứ kết U23 châu Á trên sân Abdullah bin Khalifa, thành phố Doha, Qatar, tối 25/4/2024. Ảnh: Newsis</i></span></p><p>Sau khi đẩy lượt sút luân lưu thứ 12 của Lee Kang-hee, Ernando uốn éo thân người theo phong cách Martinez từng làm, ngay trước mặt tiền vệ Hàn Quốc. Sau đó, hậu vệ Pratama Arhan sút vào loạt đá quyết định để giúp Indonesia thắng luân lưu 11-10, và vào bán kết.</p><p>Hành động của Ernando không vừa mắt trọng tài, khiến anh phải nhận thẻ vàng. Tuy nhiên, thủ môn 22 tuổi không bận tâm, vẫn mỉm cười dù bị cảnh cáo. Anh nói bản thân bị ảnh hưởng bởi phong cách của thủ môn tuyển Argentina vô địch World Cup 2022. Ernando từng so tài với Martinez, khi Indonesia đá giao hữu với Argentina tháng 6/2023.</p>','Thủ môn Indonesia xin lỗi vì múa trước cầu thủ Hàn Quốc','Thủ môn Indonesia xin lỗi vì múa trước cầu thủ Hàn Quốc',1,1);
INSERT INTO `new` VALUES (132,'','admin','2024-04-27 16:39:49',NULL,'2024-04-27 16:39:49','<p>test</p>','','test',4,2),(136,'https://res.cloudinary.com/dd1grolgr/image/upload/v1714223340/tagged-images/ruhz2dlflxnfh3p4odpu.jpg','admin','2024-04-27 20:10:25',NULL,'2024-04-28 17:50:07','<p>NINH THUẬNSau hai ngày thông xe, cao tốc Cam Lâm - Vĩnh Hảo sẽ tạm đóng từ 7h đến 18h ngày 28/4 để đảm bảo an toàn, an ninh cho lễ khánh thành.</p><p>Thông tin được Công ty CP cao tốc Cam Lâm - Vĩnh Hảo (đơn vị đầu tư dự án) cho biết chiều 27/4. Phạm vi đóng đường từ nút giao Du Long (huyện Thuận Bắc, tỉnh Ninh Thuận) đến nút giao Vĩnh Hảo (huyện Tuy Phong, tỉnh Bình Thuận).</p><p>Các xe di chuyển đến các nút giao này phải rẽ ra quốc lộ 1 theo đường kết nối tại hai nút giao trên. Cục Cảnh sát Giao thông, Bộ Công An (C08); Công an tỉnh và các Sở Giao thông của 3 tỉnh Khánh Hòa, Ninh Thuận, Bình Thuận được đề nghị phối hợp điều tiết giao thông, đảm bảo an ninh trật tự trong quá trình diễn ra lễ khánh thành.</p><figure class=\"image image_resized\" style=\"width:50.32%;\"><img style=\"aspect-ratio:1020/574;\" src=\"data:image/jpeg;base64,\" width=\"1020\" height=\"574\"></figure><p style=\"text-align:center;\"><span style=\"font-size:14px;\"><i>Cao tốc Cam Lâm - Vĩnh Hảo đoạn qua cánh đồng điện gió huyện Thuận Bắc, Ninh Thuận ngày đầu thông xe. Ảnh: Việt Quốc</i></span></p><p>Cao tốc Cam Lâm - Vĩnh Hảo dài 78,5 km, nền đường rộng 17 m với 4 làn xe không làn dừng khẩn cấp mà có các điểm dừng khẩn cấp cách nhau 4-5 km; vận tốc tối đa 90 km/h. Dự án được đầu tư theo hình thức đối tác công ty (PPP) do liên danh Tập đoàn Đèo Cả - Công ty Xây dựng Đèo Cả, Tổng công ty Đầu tư xây dựng 194 với tổng vốn đầu tư hơn 8.900 tỷ đồng.</p><p>Dự án được khởi công tháng 9/2021, đến nay đã hoàn thành, được Hội đồng kiểm tra nhà nước chấp thuận kết quả nghiệm thu của Chủ đầu tư và đã thông xe từ sáng 26/4. Lễ khánh thành dự án sẽ được tổ chức tại khu vực cửa bắc Hầm Núi Vung tại xã Phước Hà, huyện Thuận Nam, tỉnh Ninh Thuận, chiều 28/4.</p>','Đóng cao tốc Cam Lâm - Vĩnh Hảo trong 11 giờ','Đóng cao tốc Cam Lâm - Vĩnh Hảo trong 11 giờ',4,1),(153,'','admin','2024-04-28 17:01:37',NULL,'2024-04-28 17:01:47','<p>test</p>','test','test',5,2),(154,'','admin','2024-04-28 17:08:36',NULL,'2024-04-28 17:08:44','<p>test status</p>','test status','test status',7,2);
